class Reservation extends Component {

    componentDidMount() {
        this.props.fetchReservations()
      }

    render() {

        return (
            <div>
            </div>
        )
    }
}
Admin.propTypes = {
    fetchReservations: PropTypes.func.isRequired,
}
export default connect({ fetchReservations })(Admin)
